import React from "react";

const StartPage = () => {
    return (
        <div className="start-page">
            <div className="start-page-background">
                <img src={require('../media/StartBackground.jpeg')} alt="Background" />
            </div>
            <div className="start-page-content">
                
            </div>
        </div>
    );
};

export default StartPage;
